import React from "react";
import { useLocation } from "react-router-dom";
import Cake from "../assets/birthdaycake.png";

const Event = (props) => {
  console.log(props.location.state);
  return (
    <div className="w-full bg-white">
      <div className="flex flex-col justify-center items-center">
        <img
          src={Cake}
          className="my-4 w-3/4 h-1/2 object-cover rounded-xl"
          alt="/"
        />
      </div>
      <div className="text-center pt-4 antialiased">
        <h1 className="text-5xl font-semibold">
          {props.location.state.eventName}
        </h1>
        <p className="font-light text-slate-700 mt-4">
          Easily host and share events with your friends <br /> accross any
          social media.
        </p>
      </div>
    </div>
  );
};

export default Event;
